<script>
const catTextBtn = document.getElementById("catbtn");
const catSpinBtn = document.getElementById("uiai");
const cat = document.getElementById("catImg");
const textBox = document.getElementById("textBox");
const song = document.getElementById("catSong");

// новые коты
const cath1 = document.getElementById("cath1");
const cath2 = document.getElementById("cath2");

const messages = [
    "Привет Кошечка❤",
    "Как у тебя делишки?",
    "Как настроение?",
    "Что снилось тебе?)",
    "В смысле ничего?",
    "А как же я?)",
    "Ну ладно прощаю.",
    "Покушала? Жаль не меня(((",
    "Как самочувствие?)",
    "Как твоя попа?",
    "Как твоя пиписечка?",
    "Как мои сисюлики?",
    "Как мои губки?)",
    "Жаль что не со мной(",
    "А меня спросить не хочешь?)",
    "Сама ты иди",
    "НУ ЛАДНО ПРОЩАЮ",
    "САМАЯ КРАСИВАЯ ДЕВУШКА В МИРЕ",
    "САМАЯ СЕКСУАЛЬНАЯ",
    "САМАЯ ЛЮБИМАЯ",
    "САМАЯ ПРИВЛЕКАТЕЛЬНАЯ",
    "САМАЯ НЕЖНАЯ",
    "САМАЯ ЛУЧШАЯ",
    "САМАЯ СЛАДКАЯ",
    "Это все про тебя)",
    "С 14 февраля тебя Кошечка❤"
];

let currentMessage = 0;
let typingInterval = null;
let deleting = false;
let finished = false;
let textVisible = false;
let typingInProgress = false;
let spinning = false;

/* =======================
   🔴 КОТ КРУТИТСЯ
======================= */
catSpinBtn.addEventListener("click", (e) => {
    e.stopPropagation();

    if (!spinning) {
        song.currentTime = 0;
        song.play().catch(err => console.log(err));
        cat.classList.add("spin");
        spinning = true;

        song.onended = () => {
            cat.classList.remove("spin");
            spinning = false;
        };
    } else {
        song.pause();
        song.currentTime = 0;
        cat.classList.remove("spin");
        spinning = false;
    }
});

/* =======================
   🔵 КОТ С ТЕКСТОМ
======================= */
catTextBtn.addEventListener("click", (e) => {
    e.stopPropagation();

    if (finished || deleting) return;

    deleting = true;

    if (typingInProgress) {
        clearTimeout(typingInterval);
        textBox.textContent = messages[currentMessage];
        typingInProgress = false;
        deleting = false;
        textVisible = true;
        return;
    }

    if (!textVisible) {
        startTyping(messages[currentMessage]);
    } else {
        deleteText(() => {
            textVisible = false;
            deleting = false;
            currentMessage++;

            if (currentMessage >= messages.length) {

                finished = true;

                // скрываем старых котов и текст
                [catTextBtn, catSpinBtn, textBox].forEach(el => {
                    el.style.transition = "opacity 1.5s ease";
                    el.style.opacity = 0;
                });

                song.pause();
                song.currentTime = 0;
                cat.classList.remove("spin");
                spinning = false;

                // 🔥 через 3 секунды вылет новых котов
                setTimeout(showFlyingCats, 1000);

            } else {
                startTyping(messages[currentMessage]);
            }
        });
    }
});

/* =======================
   ✨ ПОЯВЛЕНИЕ КОТОВ
======================= */
function showFlyingCats() {

    if (!cath1 || !cath2) return;

    // стартовые позиции
    cath1.style.position = "absolute";
    cath2.style.position = "absolute";

    cath1.style.top = "230px";
    cath2.style.top = "454px";

    cath1.style.left = "130px";   // справа за экраном
    cath2.style.left = "-100px";  // слева за экраном

    cath1.style.opacity = "1";
    cath2.style.opacity = "1";

    

    cath1.style.transition = "left 1.2s cubic-bezier(.25,.8,.25,1)";
    cath2.style.transition = "left 1.2s cubic-bezier(.25,.8,.25,1)";

    // даём браузеру применить стартовую позицию
    setTimeout(() => {

        cath1.style.left = "50px";
        cath2.style.left = "-5px";

    }, 50);
}

/* =======================
   ТАЙПИНГ
======================= */
function startTyping(text) {
    textBox.style.opacity = 1;
    typingInProgress = true;
    textBox.textContent = "";

    typeWriter(text, 0, () => {
        typingInProgress = false;
        textVisible = true;
        deleting = false;
    });
}

function typeWriter(text, index = 0, callback) {
    if (index < text.length) {
        textBox.textContent += text[index];
        typingInterval = setTimeout(() => {
            typeWriter(text, index + 1, callback);
        }, 80);
    } else if (callback) callback();
}

function deleteText(callback) {
    const text = textBox.textContent;

    if (text.length > 0) {
        textBox.textContent = text.slice(0, -1);
        setTimeout(() => deleteText(callback), 40);
    } else if (callback) callback();
}
function createFireHeartFromHands() {

    if (!cath2) return;

    const rect = cath2.getBoundingClientRect();

    // примерная позиция лап кота
    const handX = window.innerWidth / 2;
const handY = window.innerHeight / 2;

    const particles = [];

    let index = 0;

    // создаём точки сердца
    for (let t = 0; t < Math.PI * 2; t += 0.17) {

        const delay = index * 60;

        setTimeout(() => {

            const x = 16 * Math.pow(Math.sin(t), 3);
            const y =
                13 * Math.cos(t) -
                5 * Math.cos(2 * t) -
                2 * Math.cos(3 * t) -
                Math.cos(4 * t);

            const scale = 4.5;

            const targetX = handX + x * scale;
            const targetY = handY - y * scale;

            const particle = document.createElement("div");
            particle.className = "fire-particle";

            particle.style.left = handX + "px";
            particle.style.top = handY + "px";

            document.body.appendChild(particle);

            // плавный вылет
            setTimeout(() => {
                particle.style.transition = "all 1.2s ease-out";
                particle.style.opacity = "1";
                particle.style.left = targetX + "px";
                particle.style.top = targetY + "px";
            }, 20);

            particles.push({
                el: particle,
                baseX: targetX,
                baseY: targetY,
                random: Math.random()
            });

        }, delay);

        index++;
    }

    // движение частиц внутри сердца
    let time = 0;

    const floatInterval = setInterval(() => {

        time += 0.05;

        particles.forEach(p => {

            // часть частиц двигается внутри
            if (p.random > 0.5) {

                p.el.style.left =
                    p.baseX + Math.sin(time * 2 + p.baseX) * 3 + "px";

                p.el.style.top =
                    p.baseY + Math.cos(time * 2 + p.baseY) * 3 + "px";
            }

        });

    }, 30);

    // удаление
    setTimeout(() => {
        clearInterval(floatInterval);
        particles.forEach(p => p.el.remove());
    }, 1000000);
}

cath2.addEventListener("click", () => {
    createFireHeartFromHands();
});


</script>
<script src="script.js"></script>
</body>
